const axios = require('axios');


export const authorizeInstagram = () => {
  return axios.get(`/authorize`)
  .then((response) => {
    console.log(response)
    return response.data;
  })
}

export const searchInstagram = () => {
  return axios.get('/search')
  .then((response) => {
    console.log(response);
    return response.data;
  })
}
